# THIS FUNCTION MAKES THE INPUTS AND OUTPUTS ONE COLUMN TO PUT INTO TXT FILES
def str_without_commas(string):
    c = []
    string = string.replace('[','')
    string = string.replace(']','')
    string = string.replace(',', ' ')
    mat = string.split()
    for i in mat:
        #         print i
        c.append(float(i))
    return c


